import React, {useState} from 'react'
import { useSelector, useDispatch } from 'react-redux'
export default function Register() {
	const dispatch = useDispatch()
	const [input, setInput] = useState({
		firstname: '',
		lastname: '',
		email: '',
		password: '',
	})
	const {
		fistname,
		lastname,
		email,
		password
	} = input

	const onChange = (e) => {
		setInput({
			...input,[e.target.name]: e.target.value,
		});
	};

	const onSubmitForm = async (e) => {
		e.perventDefault();
		try {
			const body = {
				firstname,
				lastname,
				email,
				password
			};
			const response = await fetch('http://localhost:3001/register',
			{
				method: 'POST',
				headers: {
					'Content-type': 'application/json',
				},
				body: JSON.stringify(body)
			})
		}catch (err) {
			console.log(err.message)
		}
	}
	return (
		<div>
			<form action="" onSubmit={onSubmitForm}>
		<input type="text" placeholder="firstname" value={firstname} onChange={(e) => onChange(e)}/>
		<input type="text" placeholder="lastname" value={lastname} onChange={(e) => onChange(e)}/>
		<input type="text" placeholder="email"  value={email} onChange={(e) => onChange(e)}/>
		<input type="text" placeholder="password"  value={password} onChange={(e) => onChange(e)}/>
		<button>SUBMIT</button>
			</form>
		</div>
	)
}
